            font-weight: bold;
            &::after {
                content: '';
                height: 100%;
                width: 60%;
                position: absolute;
                left: 16px;
                background: $purple-color;
                opacity: 0.25;
                z-index: -1;

            }
        }
        &.-range-to- {
            border: none;
            border-radius: 50%;
            background: $purple-color;
            font-weight: bold;
            &::before {
                content: '';
                height: 100%;
                width: 60%;
                position: absolute;
                right: 16px;
                background-color: $purple-color;
                opacity: 0.25;
                z-index: -1;
            }
        }
        &.-current- {
            background: linear-gradient(180deg, #6FCF97 0%, #66D2EA 100%);
            border-radius: 50%;
            color: #FFF;
            font-weight: bold;
        }
        &:hover {
            color: #fff;
            font-weight: bold;
            background-color: $purple-color;
            border-radius: 50%; 
        }
        &.-selected- {
            color: #fff;
            font-weight: bold;
            background: $purple-color;
            &.-current- {
                background: $purple-color;
                color: #fff;
                &::after, &::before {
                    background: none;
                }
            }
            &.-focus- {
                background: $purple-color;
                color: #fff;
                &::after, &::before {
                    background: none;
                }
            }
        }
        &.-in-range- {
            &::before {
                content: '';
                z-index: -1;
                background: $purple-color;
                opacity: 0.25;
                width: 100%;
                height: 100%;
                position: absolute;
            }
            background: none;
            color: $dark-shade-50-color;            
        }   
    }

    //days in other month
    &--cell-day.-other-month-, .datepicker--cell-year.-other-decade {
        color: $dark-shade-25-color;
        &:hover {
            background: $purple-color;
            color: #fff;
            font-weight: bold;
            border-radius: 50%;
        }
        &.-selected- {
            background-color: $purple-color;
        }
    }

    // clear button
    &--button {
        @include h3-text;
        padding: 0;
        margin: 0;
        color: $dark-shade-50-color;
        display: block;
        max-width: 75px;
        height: 20px;
        &:hover {
            color: $purple-color;
            background: none;
        }
        &s {
            border: none;
            display: flex;
            margin-top: 14px;
            justify-content: space-between;

        }
    }
}

